struct InnerStruct
{
    ::Ice::Int a;

    bool operator==(const InnerStruct& rhs_) const
    {
        if(this == &rhs_)
        {
            return true;
        }
        if(a != rhs_.a)
        {
            return false;
        }
        return true;
    }

    bool operator<(const InnerStruct& rhs_) const
    {
        if(this == &rhs_)
        {
            return false;
        }
        if(a < rhs_.a)
        {
            return true;
        }
        else if(rhs_.a < a)
        {
            return false;
        }
        return false;
    }

    bool operator!=(const InnerStruct& rhs_) const
    {
        return !operator==(rhs_);
    }
    bool operator<=(const InnerStruct& rhs_) const
    {
        return operator<(rhs_) || operator==(rhs_);
    }
    bool operator>(const InnerStruct& rhs_) const
    {
        return !operator<(rhs_) && !operator==(rhs_);
    }
    bool operator>=(const InnerStruct& rhs_) const
    {
        return !operator<(rhs_);
    }
};

